BEGIN TRANSACTION;
CREATE TABLE "account_emailaddress" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "verified" bool NOT NULL, "primary" bool NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "email" varchar(254) NOT NULL UNIQUE);
CREATE TABLE "account_emailconfirmation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "sent" datetime NULL, "key" varchar(64) NOT NULL UNIQUE, "email_address_id" integer NOT NULL REFERENCES "account_emailaddress" ("id"));
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(80) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"));
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "username" varchar(30) NOT NULL UNIQUE);
CREATE TABLE "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "group_id" integer NOT NULL REFERENCES "auth_group" ("id"));
CREATE TABLE "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"));
CREATE TABLE "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id"));
CREATE TABLE "corsheaders_corsmodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cors" varchar(255) NOT NULL);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id"), "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "action_time" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "django_site" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "domain" varchar(100) NOT NULL UNIQUE);
CREATE TABLE "gists_comment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "email" varchar(254) NOT NULL, "text" varchar(5000) NOT NULL, "profile_id" integer NOT NULL REFERENCES "gists_profile" ("id"), "meta" varchar(5000) NOT NULL);
CREATE TABLE "gists_gistsconfiguration" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "target_branch_depth" integer unsigned NOT NULL, "target_branch_count" integer unsigned NOT NULL, "branch_probability" real NOT NULL, "read_factor" integer unsigned NOT NULL, "write_factor" integer unsigned NOT NULL, "min_tokens" integer unsigned NOT NULL, "pause_period" integer unsigned NOT NULL, "experiment_work" integer unsigned NOT NULL, "training_work" integer unsigned NOT NULL, "base_credit" integer unsigned NOT NULL);
CREATE TABLE "gists_profile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "mothertongue" varchar(100) NOT NULL, "trained_reformulations" bool NOT NULL, "introduced_exp_home" bool NOT NULL, "introduced_exp_play" bool NOT NULL, "introduced_play_home" bool NOT NULL, "introduced_play_play" bool NOT NULL, "prolific_id" varchar(50) NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id"));
CREATE TABLE "gists_questionnaire" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "age" smallint unsigned NOT NULL, "gender" varchar(100) NOT NULL, "informed" bool NOT NULL, "informed_how" varchar(500) NOT NULL, "informed_what" varchar(500) NOT NULL, "education_level" varchar(5) NOT NULL, "education_freetext" varchar(500) NOT NULL, "job_type" varchar(5) NOT NULL, "job_freetext" varchar(500) NOT NULL, "profile_id" integer NOT NULL UNIQUE REFERENCES "gists_profile" ("id"));
CREATE TABLE "gists_sentence" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "text" varchar(5000) NOT NULL, "read_time_proportion" real NOT NULL, "read_time_allotted" real NOT NULL, "write_time_proportion" real NOT NULL, "write_time_allotted" real NOT NULL, "language" varchar(100) NOT NULL, "bucket" varchar(100) NOT NULL, "parent_id" integer NULL REFERENCES "gists_sentence" ("id"), "profile_id" integer NOT NULL REFERENCES "gists_profile" ("id"), "tree_id" integer NOT NULL REFERENCES "gists_tree" ("id"), "tree_as_root_id" integer NULL UNIQUE REFERENCES "gists_tree" ("id"));
CREATE TABLE "gists_tree" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "last_served" datetime NOT NULL);
CREATE TABLE "gists_wordspan" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "span" smallint unsigned NOT NULL, "score" smallint unsigned NOT NULL, "profile_id" integer NOT NULL UNIQUE REFERENCES "gists_profile" ("id"));
CREATE TABLE "socialaccount_socialaccount" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "provider" varchar(30) NOT NULL, "last_login" datetime NOT NULL, "date_joined" datetime NOT NULL, "extra_data" text NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "uid" varchar(191) NOT NULL);
CREATE TABLE "socialaccount_socialapp" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "provider" varchar(30) NOT NULL, "name" varchar(40) NOT NULL, "client_id" varchar(191) NOT NULL, "key" varchar(191) NOT NULL, "secret" varchar(191) NOT NULL);
CREATE TABLE "socialaccount_socialapp_sites" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "socialapp_id" integer NOT NULL REFERENCES "socialaccount_socialapp" ("id"), "site_id" integer NOT NULL REFERENCES "django_site" ("id"));
CREATE TABLE "socialaccount_socialtoken" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "token" text NOT NULL, "token_secret" text NOT NULL, "expires_at" datetime NULL, "account_id" integer NOT NULL REFERENCES "socialaccount_socialaccount" ("id"), "app_id" integer NOT NULL REFERENCES "socialaccount_socialapp" ("id"));
